import React, { useState, useEffect } from 'react';
import logo from '../resources/logo.png';
import Tooltip from 'react-tooltip';
import 'react-tooltip/dist/react-tooltip.css';
import '../css/MenuBar.css';

const MenuBar = ({ toggleVideoHistory }) => {

  useEffect(() => {
    Tooltip.rebuild();
  }, []);

  return (
    <div id="menu-bar">
      <p
        id="menu-bar-rules"
        data-tip="Tooltip content"
      >
        Rules
      </p>
      <Tooltip place="bottom" effect="solid"/>
      <div id="yousub">
        <img src={`${logo}?${new Date().getTime()}`} alt="Logo" />
        <p>yousub.</p>
      </div>
      <div id="menu-bar-right" style={{ marginRight: '1rem' }}>
        <p id="menu-bar-history" onClick={toggleVideoHistory}>
          History
        </p>
        <p id="menu-bar-logout">Log out</p>
      </div>
    </div>
  );
};

export default MenuBar;
